import React, { useState } from 'react'
import { Navigate } from 'react-router-dom';
import Base from "../core/Base";
import { signup } from './helper';


const Signin = () => {

    const [values, setValues]=  useState({
        name: "",
        email:"",
        contact:"", 
        error: "",
        success: false,
    });
    const [event, setEvent] = useState("abc");
    const [row, setRow] = useState(0);
    const [col, setCol] = useState(0);
    const {name, email, contact, error, success} = values;

    const handleChange = name => event_case => {
        setValues({...values,error: false, [name]: event_case.target.value})
    }

    const loadCart = () => {
        let EventName = "";
        let Row = 0; 
        let Col = 0;
        console.log("loadCart is hit")
        if (typeof window !== undefined){
            if (localStorage.getItem("EventName")){
                EventName = JSON.parse(localStorage.getItem("EventName"))
            }
        }
        if (typeof window !== undefined){
            if (localStorage.getItem("Row")){
                Row = JSON.parse(localStorage.getItem("Row"))
            }
        }
        if (typeof window !== undefined){
            if (localStorage.getItem("Col")){
                Col = JSON.parse(localStorage.getItem("Col"))
            }
        }
        console.log("EventName", EventName)
        console.log("Row", Row)
        console.log("Col", Col)
        setEvent(EventName);
        setRow(Row);
        setCol(Col);
        setEvent(EventName);
        setRow(Row);
        setCol(Col);
        console.log("values for row, event, col", row, event, col)
    }


    const onSubmit=(event_case)=>{
        console.log("why why")
        loadCart();

        event_case.preventDefault();
        setValues({...values, error: false})
        signup({name,email,contact, event, row, col})    // replace 1 and 5 with (row, col)
        .then((data)=> {
            console.log("DATA", "-------", data);
            if(data.details.event === event){
                setValues({
                    ...values,
                    name:"",
                    email: "",
                    contact: "",
                    error: "",
                    success: true
                })
            }
            else{
                setValues({
                    ...values,
                    error: true,
                    success: false
                })
            }
        }
        )
        .catch(err => console.log(err))


    }

    const successMessage =() => {
        console.log("success", success)
        return (
            <div className="row">
                <div className="col-md-6 offset-sm-3 text-left">
                    <div className="alert-success" style={{display: success ? "" : "none" }}>
                        Ticket saved successfully.

                    </div>
                </div>
            </div>
        )
    } 
    const errorMessage =() => {
        return (
            <div className="row">
                <div className="col-md-6 offset-sm-3 text-left">
                    <div className="alert alert-danger" style={{display: error ? "" : "none" }}>
                        something went wrong
                    </div>
                </div>
            </div>
        )
    } 

    const signUpForm=()=>{
        return (
            <div className="row">
                <div className="col-md-6 offset-sm-3 text-left">
                    <form>
                      <div className="form-group">
                          <label className="text-light">
                              Name
                          </label>
                          <input type="text"
                          className="form-control"
                          values={name}
                          onChange={handleChange("name")}/>
                      </div>
                      <div className="form-group">
                          <label className="text-light">
                              Email
                          </label>
                          <input type="text"
                          className="form-control"
                          values={email}
                          onChange={handleChange("email")}/>
                      </div>
                      <div className="form-group">
                          <label className="text-light">
                              Contact
                          </label>
                          <input type="text"
                          className="form-control"
                          values={contact}
                          onChange={handleChange("contact")}/>
                      </div>
                      <button onClick={onSubmit} className="btn btn-success btn-block">Submit</button>
                    </form>

                </div>
            </div>    
        )
    }





  return (
    <Base title = "Grab your Ticket" description = "Enter your email and name for confirmation">
    {successMessage()}
    {errorMessage()}
    {signUpForm()}
    <p className="text-white text-center">
                {JSON.stringify(values)}
            </p>
    </Base>
  )
}


export default Signin;
